package io.hischoolboy.acl.convert;import io.hischoolboy.acl.dto.LogSearchDto;import io.hischoolboy.acl.vo.LogPara;import java.sql.Timestamp;public class LogConvert {    public static LogSearchDto of(LogPara para) {        LogSearchDto dto = LogSearchDto.builder().type(para.getType()).beforeSeg(para.getBeforeSeg()).afterSeg(para.getAfterSeg()).targetId(para.getTargetId())                .operator(para.getOperator()).fromTime(Timestamp.valueOf(para.getFromTime())).toTime(Timestamp.valueOf(para.getToTime())).build();        return dto;    }}